import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div style = {{}}>
        <div style = {{backgroundColor: 'green',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}></div>
        <div style = {{backgroundColor: 'red',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}></div>
        <div style = {{backgroundColor: 'pink',
          height: '100px',
          width: '90%',
          borderRadius: '30px',
          margin: 'auto'
        }}></div>
      </div>
    );
  }
}

export default App;
